webpackJsonp([0x9e01fdd051b8],{1211:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Psyked: James' Web Development website",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/link-face-tracking-and-3d-scene/index.md absPath of file >>> MarkdownRemark",html:'<p><img src="/content/images/2011/03/mrdoob.png" alt="Snapshot from the 3D Scene and Face tracking demo" title="Snapshot from the 3D Scene and Face tracking demo"></p>\n<p>I may be slow on the uptake here, but Mr.doob has some awesome HTML5 and Flash Player showcase pieces over at [mrdoob.com](<a href="http://mrdoob.com/">http://mrdoob.com/</a> "Open "mrdoob.com" in a new window."). It\'s hard to pick a favorite, because they\'re all darn impressive, but I\'m a fan of the [Face-tracking and 3D Scene demo](<a href="http://mrdoob.com/90/Face_tracking_+_3D_Scene">http://mrdoob.com/90/Face<em>tracking</em>+<em>3D</em>Scene</a> "Open "mrdoob.com"s Face tracking and 3D Scene demo in a new window.") (which I\'ve screenshotted above).  It\'s based in Flash, because it has to access the computers\' webcam, and is a pretty neat concept.</p>\n<p>If it didn\'t require the whole webcam-access notification message that makes the whole effect so obvious, I\'d definitely want to slide this into loads of projects, just for the hell of it!</p>',frontmatter:{title:"Link: Face-tracking and 3D Scene",date:"March 28, 2011",tags:["external-links","flash","face-detection","webcam"],url:null,image:null,description:null}}},pathContext:{prev:{frontmatter:{path:"/blog/the-dom-monster/",tags:["javascript"],title:"The DOM Monster",date:"2011-03-24T17:22:57.000Z"}},next:{frontmatter:{path:"/blog/experiments-with-html5-geolocation/",tags:["html5","geolocation"],title:"Experiments with HTML5 Geolocation",date:"2011-04-12T22:01:55.000Z"}}}}}});
